// ==UserScript==
// @name           Youtube Homepage Swap
// @version        1.2.8
// @namespace      Hpr222
// @description    Allows you to switch between the look of the current YouTube homepage and the one that YouTube is soon to release!
// @downloadURL    http://userscripts.org/scripts/source/138883.user.js
// @updateURL      http://userscripts.org/scripts/source/138883.meta.js
// @grant          none
// @include        *.youtube.com/*
// @exclude        http*://*.youtube.com/embed/*
// @icon           data:image/png;base64,
// ==/UserScript==

//Thanks for helping fix this script kuzu! I could have never done it without your help!
(function(){
"use strict";
var cookienew = "VISITOR_INFO1_LIVE=AcxpB_GgV6w";
var cookiecurrent = "VISITOR_INFO1_LIVE=0";
//Stops iFrame
if (window.frameElement) {
return;
}
else {
readcookie();
}


function readcookie() {
var c_name = "VISITOR_INFO1_LIVE";
var c_value = "AcxpB_GgV6w";

var button = document.createElement ("button");
button.setAttribute ('class', 'yt-uix-tooltip-reverse yt-uix-button yt-uix-button-text yt-uix-tooltip');
button.setAttribute ('role', 'button');
button.setAttribute ('type', 'button');
button.setAttribute ('title', 'Youtube Homepage Swap Button');
button.setAttribute ('id', 'masthead-user-button');
if (document.getElementById("masthead-user-expander")) {
  button.setAttribute ('style', 'vertical-align: middle');
}
var btct = document.createElement ("span");
btct.setAttribute ('class', 'yt-uix-button-content');
btct.innerHTML = '<span>Swap Homepage</span>';
button.appendChild(btct);
var placer = document.getElementById("masthead-user") || document.getElementById("yt-masthead-user") || document.getElementById("yt-masthead-signin");
if (placer) {
  if (document.getElementById("yt-masthead-signin")) {
    button.style.marginLeft = "10px";
  }
  placer.appendChild(button);
}
if (document.getElementById ("masthead-user-display")) {
  document.getElementById ("masthead-user-display").setAttribute ('style', 'display: inline;');
}
if (document.getElementById ("masthead-user-expander")) {
  document.getElementById ("masthead-user-expander").setAttribute ('style', 'vertical-align: middle');
}

var i,x,y,ARRcookies=document.cookie.split(";");
for (i=0;i<ARRcookies.length;i++)
  {
  x=ARRcookies[i].substr(0,ARRcookies[i].indexOf("="));
  y=ARRcookies[i].substr(ARRcookies[i].indexOf("=")+1);
  x=x.replace(/^\s+|\s+$/g,"");
  if (x==c_name)
    {
    if (y!==c_value)
    {
      //sets the cookie to the new look
      if (document.cookie.search(cookienew) === -1)
	  {1
	  button.addEventListener ("click", NewCookie, false);
	  }
    }
    else
      {
      button.addEventListener ("click", OldCookie, false);
    }
  }
}

function NewCookie() {
document.cookie = cookienew+'; expires=31536000000; domain=.youtube.com; path=/';
location.reload();
}

function OldCookie() {
document.cookie = cookiecurrent+'; expires=31536000000; domain=.youtube.com; path=/';
location.reload();
}
}
})();